import React from 'react'
import { useNavigate } from 'react-router-dom'

function admin() {

  const navigate = useNavigate()

  const logout=()=>{
    localStorage.removeItem('token')
    navigate('/')

  }
  return (
    <div>
     <button class='btn' onC>Logout</button>
      
    </div>
  )
}

export default admin
